import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { fetchDashboardData } from '../../services/api';
import { useAuth } from '../../context/AuthContext';
// import Sidebar from '../sidebar/sidebar'; // Make sure this path is correct

const Dashboard = () => {
  const { authTokens, logout } = useAuth();
  const [data, setData] = useState({ files: [], folders: [], notifications: [] });
  const [loading, setLoading] = useState(true);
  const navigate = useNavigate();

  useEffect(() => {
    const getDashboardData = async () => {
      try {
        const response = await fetchDashboardData(authTokens);
        setData(response.data);
      } catch (err) {
        console.error('Failed to fetch dashboard data', err);
      } finally {
        setLoading(false);
      }
    };

    getDashboardData();
  }, [authTokens]);

  const handleLogout = () => {
    logout();
    navigate('/login');
  };

  if (loading) return <p>Loading dashboard... ‚è≥</p>;

  return (
    <div className="flex h-screen bg-gray-100">



      <div className="flex-1 flex flex-col overflow-hidden">
        <main className="flex-1 overflow-x-hidden overflow-y-auto bg-gray-200">
          <div className="container mx-auto px-6 py-8">
            <h1 className="text-3xl font-bold text-gray-800 mb-6">Welcome to your Dashboard üìÇ</h1>

            <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
              <section className="bg-white p-6 rounded-lg shadow-md">
                <h2 className="text-xl font-semibold mb-4 text-gray-700">Recent Files üìÑ</h2>
                <ul className="space-y-2">
                  {data.files.map(file => (
                    <li key={file.id} className="text-gray-600 hover:text-gray-800">{file.name}</li>
                  ))}
                </ul>
              </section>

              <section className="bg-white p-6 rounded-lg shadow-md">
                <h2 className="text-xl font-semibold mb-4 text-gray-700">Recent Folders üìÅ</h2>
                <ul className="space-y-2">
                  {data.folders.map(folder => (
                    <li key={folder.id} className="text-gray-600 hover:text-gray-800">{folder.name}</li>
                  ))}
                </ul>
              </section>

              <section className="bg-white p-6 rounded-lg shadow-md">
                <h2 className="text-xl font-semibold mb-4 text-gray-700">Notifications üîî</h2>
                <ul className="space-y-2">
                  {data.notifications.map(notification => (
                    <li key={notification.id} className="text-gray-600 hover:text-gray-800">{notification.message}</li>
                  ))}
                </ul>
              </section>
            </div>

            <button 
              onClick={handleLogout}
              className="mt-8 bg-red-600 text-white px-6 py-2 rounded hover:bg-red-700 transition duration-300"
            >
              Logout üö™
            </button>
          </div>
        </main>
      </div>
    </div>
  );
};

export default Dashboard;



